pragma solidity ^0.8.10;

library Shared {
    struct RealState {
        string city;
        string street;
        uint number;
        uint meters;
        uint registration;
        string owner;
        uint price;//nuevo campo

    }

}


contract RealStateContractCities {
    address payable public administrator  = payable(0x50d3b84a2b1787b7704DD50c67733b6b5B293629);
     uint public authorizedAddressesCount;

    mapping(address => bool) public authorizedAddresses;
    address[] public authorizedAddressesList;
    modifier onlyAdministrator() {
        require(msg.sender == administrator, "Only the administrator can call this function");
        _;
    } 
    mapping( string => Shared.RealState[]) public realStateMap;
    mapping(uint => Shared.RealState) public globalRealStateMap;

function addAuthorizedAddress(address _newAuthorized) public onlyAdministrator {
        authorizedAddresses[_newAuthorized] = true;
        authorizedAddressesList.push(_newAuthorized);
    }


function removeAuthorizedAddress(address _authorizedToRemove) public onlyAdministrator {
        authorizedAddresses[_authorizedToRemove] = false;
        // Encuentra y elimina la direccin de la lista
        for (uint i = 0; i < authorizedAddressesList.length; i++) {
            if (authorizedAddressesList[i] == _authorizedToRemove) {
                authorizedAddressesList[i] = authorizedAddressesList[authorizedAddressesList.length - 1];
                authorizedAddressesList.pop();
                break;
            }
        }
    }
function getAuthorizedAddresses() public view returns (address[] memory) {
        return authorizedAddressesList;
    }


function getRealStateByRegistration(uint _registration) public view returns (Shared.RealState memory) {
        return globalRealStateMap[_registration];
    }

function getRealStateByCity (string calldata _city) public view returns(Shared.RealState[] memory) {
        Shared.RealState[] memory result = realStateMap[_city];
        for (uint i = 0; i < result.length; i++) {
            if (msg.sender != administrator && !authorizedAddresses[msg.sender]) {
                // Si el solicitante no es el administrador ni una direccin autorizada, ocultar el precio
                result[i].price = 0;
            }
        }
        return result;
   }
function addRealState(Shared.RealState calldata realState) public  {
        require(msg.sender == administrator || authorizedAddresses[msg.sender], "Not authorized");

        // Verificar si ya existe un RealState con el mismo registro
        Shared.RealState storage existingRealState = globalRealStateMap[realState.registration];

        if (existingRealState.registration != 0) {

            // Eliminar el RealState existente
            deleteRealStateByRegistration(realState.registration);
        }

        realStateMap[realState.city].push(realState);
        globalRealStateMap[realState.registration] = realState;

    }

      function deleteRealStateByRegistration(uint _registration) public {
        // Obtener la ciudad del RealState a eliminar
        string memory city = globalRealStateMap[_registration].city;

        // Encontrar y eliminar el RealState en el mapeo por ciudad
        for (uint i = 0; i < realStateMap[city].length; i++) {
            if (realStateMap[city][i].registration == _registration) {
                 // Reorganizar el array despus de la eliminacin
                if (i < realStateMap[city].length - 1) {
                    realStateMap[city][i] = realStateMap[city][realStateMap[city].length - 1];
                }
                // Reducir la longitud del array
                realStateMap[city].pop();

                break;
            }
        }

        // Eliminar el RealState del mapeo global
        delete globalRealStateMap[_registration];
    }

}


contract RealStateContract{
        struct RealState {
        string city;
        string street;
        uint number;
        uint meters;
        uint registration;
        string owner;

    }
    RealState[] public realStateArray;

    function addRealState(string calldata _city, string calldata _street, 
            uint _number, uint _meters, uint _registration, string calldata _owner) public {
           // Verificar si ya existe una propiedad con el mismo registration
        for (uint i = 0; i < realStateArray.length; i++) {
            if (realStateArray[i].registration == _registration) {
                 realStateArray.push(RealState(_city,_street,_number,_meters,_registration,_owner));
                // Eliminar el RealState existente
                deleteRealStateByRegistration(_registration);
                break;
            }
        }

        realStateArray.push(RealState(_city,_street,_number,_meters,_registration,_owner));
    }

      function getRealStateByRegistration (uint _registration) public view returns(RealState memory) {
        for(uint i =0; i < realStateArray.length; i++){
            if (realStateArray[i].registration == _registration){
                return realStateArray[i];
            }
        }
                revert("Not found RealState with this registration");
    }
    function deleteRealStateByRegistration(uint _registration) public {
        for(uint i =0; i < realStateArray.length; i++){
            if (realStateArray[i].registration == _registration){
                delete realStateArray[i];

                for(uint j =i; j < realStateArray.length-1; j++){
                    realStateArray[j] = realStateArray[j+1];
                }

                realStateArray.pop(); // delete the last
                // Important to reduce -1 the leght of array

                return; // for finish method
            }
        }
    }

    function getRealStateByCity (string calldata _city) public view returns(RealState[] memory) {
        uint resultLength = 0;
        for(uint i =0; i < realStateArray.length; i++){
            if (keccak256(bytes(realStateArray[i].city)) == keccak256(bytes(_city))){
                resultLength++;
            }
        }
        RealState[] memory rsReturn = new RealState[](resultLength);

        uint positionInsert = 0;
        for(uint i =0; i < realStateArray.length; i++){
            if (keccak256(bytes(realStateArray[i].city)) == keccak256(bytes(_city))){
                rsReturn[positionInsert] = realStateArray[i];
                positionInsert++;
            }
        }

        return rsReturn;
    }





